const Header = (props) => {
  return (
      <h1>{props.course}</h1>
  )
}


const Total = (props) => {
  return (
      <p>
      it is the total component, Number of exercises {props.exercises1 + props.exercises2 + props.exercises3} 
      </p>
  )
}

const Part = (props) => {
  <p>{props.part} {props.exercises}</p>
}


const Content = () => {
  const part1 = 'Fundamentals of React'
  const exercises1 = 10
  return (
    <div>
      <Part part={part1} exercises={exercises1} />
    </div>
  )
}



const App = () => {
  const course = 'Half Stack application development'
  const part1 = 'Fundamentals of React'
  const exercises1 = 10
  const part2 = 'Using props to pass data'
  const exercises2 = 7
  const part3 = 'State of a component'
  const exercises3 = 14

  return (
    <>
      <Header course={course} />
      <Content />
      <Total exercises1={exercises1}
             exercises2={exercises2}
             exercises3={exercises3} />
    </>
  )
}

export default App
